const pratikImg = require("../../../assets/contacts/pratik.png");
const atulImg = require("../../../assets/contacts/atul.png");
const meghaImg = require("../../../assets/contacts/megha.png");
const sauravImg = require("../../../assets/contacts/saurav.png");
const varunImg = require("../../../assets/contacts/varun.png");

const data = [
  {
    thumbnail: atulImg,
    name: "Atul Ranjan",
    icon: "phone-portrait"
  },
  {
    thumbnail: pratikImg,
    name: "Kumar Pratik",
    icon: "call"
  },
  {
    thumbnail: varunImg,
    name: "Varun",
    icon: "call"
  },
  {
    thumbnail: meghaImg,
    name: "Megha Kumari",
    icon: "phone-portrait"
  },
  {
    thumbnail: sauravImg,
    name: "Saurav",
    icon: "call"
  }
];

module.exports = data;
